import { useParams } from "react-router-dom"

const WelcomeNewUser = () => {

    const params = useParams();

  return (
    <section>
      <h1>The Welcome Page</h1>
      <p>Welcome, {params.newuser}!</p>
    </section>
  );
};

export default WelcomeNewUser;
